import React from 'react';
import CardList from '../card/cards-list.component';
import { members } from './../../config/config';
import { StyledList, Wrapper, StyledHeader } from './styles';

const Header = () => {

    return (<Wrapper>
        {members.map((member, index: number) => {
            return <StyledList>
                <StyledHeader color={member.hexCode}>{member.name}</StyledHeader>
                <CardList colIndex={index}></CardList>
                <button>Add a card</button>
            </StyledList>
        })}
    </Wrapper>);
}

export default Header;
